DROP TABLE IF EXISTS Participate CASCADE;

CREATE TABLE Participate (
    Player_ID INTEGER REFERENCES Player(Player_ID),
    GC_ID INTEGER REFERENCES Grand_Slam(GC_ID),
    _Year INTEGER CHECK (_Year IN (2022, 2021)) NOT NULL,
    Category VARCHAR(64) CHECK (Category IN ('Men’s Singles', 'Women’s Singles')) NOT NULL,
    Result VARCHAR(64) CHECK (Result IN ('1/64 Finalist', '1/32 Finalist', '1/16 Finalist', '1/8 Finalist', '1/4 Finalist', '1/2 Finalist', 'Runner-up', 'Champion')) NOT NULL,
    PRIMARY KEY(Player_ID, GC_ID, _Year)
);

















